// RegistrationPage.js

import React, { useState } from 'react';
import { TextField, Button, Container, Typography, Grid, CssBaseline } from '@mui/material';
import axios from 'axios';
import '../style/RegistrationPage.css';

const RegistrationPage = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
  });
  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const callRegisterAPI = async () => {

    const BASE_API_URL = process.env.REACT_APP_API_BASE_URL || '';

    console.log('BASE_API_URL:', BASE_API_URL);
    const json = JSON.stringify({
        username: formData.username,
        email: formData.email,
        password: formData.password,
    });

    try {
        const response = await axios.post(`${BASE_API_URL}/register`, json, {
            headers: {
                'Content-Type': 'application/json'
            }
        });
  // Check for success (2xx status codes)
  if (response.status >= 200 && response.status < 300) {
    console.log('Registration successful');
  } else if (response.status === 400) {
    // Handle specific error for 400 Bad Request
    const errorData = await response.json(); // Assuming the error details are in JSON format
    console.error('Bad Request:', errorData);
    // Handle the error, update state, or show a user-friendly message
  } else {
    // Handle other error status codes
    console.error('Error:', response.statusText);
    // Handle the error, update state, or show a user-friendly message
  }
} catch (error) {
  console.error('Error:', error.message);
  // Handle the error, update state, or show a user-friendly message
}

  }


  const validateForm = () => {
    const newErrors = {};

    if (!formData.username.trim()) {
      newErrors.username = 'Username is required';
    }

    if (!formData.email.trim()) {
      newErrors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
      newErrors.email = 'Invalid email address';
    }

    if (!formData.password) {
      newErrors.password = 'Password is required';
    } else if (formData.password.length < 6) {
      newErrors.password = 'Password must be at least 6 characters';
    }

    if (formData.password !== formData.confirmPassword) {
      newErrors.confirmPassword = 'Passwords do not match';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (validateForm()) {
        callRegisterAPI();
      setFormData({
        username: '',
        email: '',
        password: '',
        confirmPassword: '',
      });
      setErrors({});
    } else {
      console.log('Form validation failed');
    }
  };

  return (
    <Container component="main" maxWidth="xs" className="container">
      <CssBaseline />
      <div className="paper">
        <Typography variant="h5">Registration</Typography>
        <form onSubmit={handleSubmit} noValidate className="form">
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="username"
                label="Username"
                name="username"
                value={formData.username}
                onChange={handleChange}
                error={!!errors.username}
                helperText={errors.username}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="email"
                label="Email Address"
                name="email"
                value={formData.email}
                onChange={handleChange}
                error={!!errors.email}
                helperText={errors.email}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="password"
                label="Password"
                type="password"
                id="password"
                value={formData.password}
                onChange={handleChange}
                error={!!errors.password}
                helperText={errors.password}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="confirmPassword"
                label="Confirm Password"
                type="password"
                id="confirmPassword"
                value={formData.confirmPassword}
                onChange={handleChange}
                error={!!errors.confirmPassword}
                helperText={errors.confirmPassword}
              />
            </Grid>
          </Grid>
          <Button
            className="submitBtn"
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
          >
            Register
          </Button>
        </form>
      </div>
    </Container>
  );
};

export default RegistrationPage;
